import React, { useEffect, useState } from "react";
import { useSelector } from "react-redux";

import axios from "../../axios";

import { Card } from "../../components/ui/CardsComponents/index";

const Favorites = () => {
  const userData = useSelector((state) => state.auth.data);
  const [cards, setCards] = useState([]);

  useEffect(() => {
    const favoritesCards = axios.get(`/favorites:${userData?._id}`);
    setCards(favoritesCards);
  }, []);

  return (
    <div className="favorites-contaner">
      {cards ? (
        cards.map((card) => {
          <Card card={card} />;
        })
      ) : (
        <h1>You have not added any products to your favorites</h1>
      )}
    </div>
  );
};

export default Favorites;
